import logo from './logo.svg';
import './App.css';
import {Component} from "react";

class NewComponent extends Component {
    thing(num) {
        let value = 0;
        let previous = 0;
        for (let i = 0; i < num; i++) {
            value = value + previous;
            previous = value;
            console.log(value);
        }
        return value;
    }
    render() {
        return (
            <div>
                <h1>Hello, world!</h1>
                // on click increment count and pass it to thing
                <button onClick={() => this.thing(10)}>Click me</button>
            </div>
        );
    }
}

function App() {
  return (
    <div className="App">
        <header className="App-header">
            <img src={logo} className="App-logo" alt="logo"/>
            <p>
                Edit <code>src/App.js</code> and save to reload.
            </p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
                Learn React
            </a>
        </header>
        <NewComponent/>
    </div>
  );
}

export default App;
